import React from "react";

class Header extends React.Component {
    render() {
        return (
            <header>
                <h1>
                    Catch
                    Of the
                    Day
                </h1>
                <h3>
                    <span>Fresh Faily</span>
                </h3>
            </header>
        )
    }
}
